import React from "react";
import Navbar from "../components/Navbar";
import CEOImg from "../assets/avishek.jpg"; 
import MDImg from "../assets/sushil.png";
import COOImg from "../assets/sabin.jpg";
import CIOImg from "../assets/pranay.jpg";
// import PMImg from "../assets/sujan.jpg";
import QAImg from "../assets/promish.jpg";
import './styles.css'

function Team() {
  return (
    <>
    <Navbar/>
    <h2>Meet our team here at Saptam Technologies</h2>
      <div className="Team">
        <img src={CEOImg} alt="CEO Image"></img>
        <img src={MDImg} alt="MD Image"></img>
        <img src={COOImg} alt="COO Image"></img>
        <img src={CIOImg} alt="CIO Image"></img>
        {/* <img src={PMImg} alt="PM Image"></img>  */}
        <img src={QAImg} alt="QA Image"></img>
        
      </div>
    </>
  );
}

export default Team;
